Cannondale Slice 5 women's bike is built for speed in triathlons or local time trials. The aerodynamic carbon frame and Shimano 105 group is there to get you to the finish line faster.&nbsp;
<div><br></div><div><ul><li><span style="font-family: undefined; font-size: 12px;">Slice carbon frame features aerodynamic tube shapes and Aero Save micro-suspension, which enables the rear chainstays and seatstays to damp road vibrations while staying stiff&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">All-carbon fork slices through the air and helps keep weight low&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">Overall geometry of the Slice 5 has been tuned to offer stable, comfortable handling while tucked in the aero position&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">BB30 bottom bracket design increases stiffness for improved power transfer&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">FSA Gossamer Pro crankset delivers your pedaling power through the drivetrain; Shimano 105 derailleurs and bar-end shifters dependably shift through the 20 gears&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">47cm size uses 650c wheels so smaller riders don’t have to compromise their fit or aerodynamics, enabling the ideal low position and reducing toe overlap as well&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">Maddux rims are wrapped with fast 700c Schwalbe Lugano tires (650c Vittoria Rubino on the 47cm model) for excellent handling and speed&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">Cannondale C3 base bar and FSA Tri Max Team clip-ons provide adjustable positioning with confident handling&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">2-position seatpost offers a range of effective seat angle adjustment from 73 - 78° for triathlon or UCI-legal time trial use&nbsp;</span><br></li><li><span style="font-family: undefined; font-size: 12px;">Please note: pedals are not included
